def dotProd2(x,y): return sum([x1*y1 for (x1,y1) in zip(x,y)])
def transpose(l1):
    l2=[]
    for i in range(len(l1[0])):
        row=[]
        for item in l1: row.append(item[i])
        l2.append(row)
    return l2
def dotProd(x,y): return [[dotProd2(x2,y2) for y2 in transpose(y)] for x2 in x]
def convertToBinPuzzle(puzzleList,mainBoard):
    curr=[]
    for y in mainBoard: 
        currIndex=puzzleList.index(y)
        bin=format(currIndex,'b')
        bin=[int(x) for x in bin]
        while(len(bin) < 4): bin=[0] + bin
        for b in bin: curr.append(b)
    return curr

def relu(x):
    if x > 0: return x
    else: return 0
def linear(x): return x
def relu2(x):
    newL=[]
    for x2 in x:
        newL2=[]
        for y in x2: 
            newL2.append(max(y,0))
        newL.append(newL2)
    return newL
def addMat(x,y): return [[x[0][x3] + y[0][x3] for x3 in range(len(x[0]))]]
def p_net3(A,x,w_list):
    a=list()
    a.append(list(x))
    for l in range(1,len(w_list)+1): a.append(A(dotProd(a[l-1],w_list[l-1])))
    return a[len(w_list)]
def p_net2(A,x,w_list,b_list):
    a=list()
    a.append(list(x))
    for l in range(1,len(w_list)+1): a.append(A(addMat((dotProd(a[l-1],w_list[l-1])),b_list[l-1])))
    return a[len(w_list)]
